import React from 'react'
import s from './Precart.module.css'
import { useSelector } from 'react-redux'
import { Link } from 'react-router-dom'

export default function Precart() {
  const cart_products = useSelector(state => state.precart)

  return (
    <div className={s.precart}>
        {cart_products.length === 0 ? 
          <div className={s.h3}>Your cart is empty, please select something <Link to={'/products'} >here</Link></div>:
          cart_products.map(el => 
            <div key={el.id}>
              <div style={{width: '30px', height: '30px', backgroundImage: `url${el.image}`}} alt='product' />
              {el.title}
            </div>
          )
        }
    </div>
  )
}
